import React from 'react';
import './sub-about.css';
const SubAbout = () => {
  return (
    <div className="sub-about border">
      <div className="container border flex">
        <div>
          <h2>نبذة عن   ماني ليك </h2>
            <p>ثري هاند أفضل شركة تصميم مواقع، ودا لأننا عندنا خبرة كبيرة في المجال ده وبنقدم خدماتنا من 15 سنة، وخلال الفترة دي عملنا عدد كبير من المواقع الإلكترونية والمتاجر الإلكترونية، وعندنا أكبر سابقة أعمال في مصر.</p>
        </div>
    </div>
    </div>
  );
}

export default SubAbout;
